import React from 'react';
import { Table, Space, Button, Input } from 'antd';
import { SearchOutlined } from '@ant-design/icons';
import './index.css';

const AdminUser = () => {
  const onSearch = value => console.log(value);

  const columns = [
    {
      title: '用户账号',
      dataIndex: 'userId',
      key: 'userId',
    },
    {
      title: '所属学校',
      dataIndex: 'address',
      key: 'address',
      render: () => (
        <div>华东师范大学</div>
      )
    },
    {
      title: '操作',
      key: 'action',
      render: () => (
        <Space size="middle">
          <a>删除</a>
        </Space>
      ),
    },
  ];

  const data = [
    {
      key: '1',
      name: 'John Brown',
      userId: 32,
      address: 'New York No. 1 Lake Park',
      identity: '你好',
    },
    {
      key: '2',
      name: 'John Brown',
      userId: 32,
      address: 'New York No. 1 Lake Park',
      identity: '你好',
    },
    {
      key: '3',
      name: 'John Brown',
      userId: 32,
      address: 'New York No. 1 Lake Park',
      identity: '你好',
    },
    {
      key: '4',
      name: 'John Brown',
      userId: 32,
      address: 'New York No. 1 Lake Park',
      identity: '你好',
    },
    {
      key: '5',
      name: 'John Brown',
      userId: 32,
      address: 'New York No. 1 Lake Park',
      identity: '你好',
    },
  ];
  return (
    <div className="admin-user">
      <Input.Search
        style={{ float: 'right', width: 400, marginBottom: '20px', marginLeft: '20px' }}
        placeholder="请输入"
        allowClear
        enterButton="查询"
        size="large"
        onSearch={onSearch}
        prefix={<SearchOutlined />}
      />
      <Button size="large" style={{ float: 'right' }}>新增</Button>
      <Table columns={columns} dataSource={data} />
    </div>
  );
}
export default AdminUser;
